-- Verificar contagem de registros
SELECT 'regime_urbanistico' as tabela, COUNT(*) as registros FROM regime_urbanistico
UNION ALL
SELECT 'zots_bairros' as tabela, COUNT(*) as registros FROM zots_bairros;

-- Verificar bairros únicos
SELECT 'Bairros únicos em regime_urbanistico' as info, COUNT(DISTINCT bairro) as total FROM regime_urbanistico
UNION ALL
SELECT 'Bairros únicos em zots_bairros' as info, COUNT(DISTINCT bairro) as total FROM zots_bairros;

-- Verificar zonas únicas
SELECT 'Zonas únicas em regime_urbanistico' as info, COUNT(DISTINCT zona) as total FROM regime_urbanistico
UNION ALL
SELECT 'Zonas únicas em zots_bairros' as info, COUNT(DISTINCT zona) as total FROM zots_bairros;

-- Verificar bairros com zona especial
SELECT bairro, COUNT(*) as zonas_especiais 
FROM zots_bairros 
WHERE tem_zona_especial = TRUE 
GROUP BY bairro 
ORDER BY bairro;

